              radius 0.043
            }
          }
        ]
      }
      Transform {
        translation 0 0 0.122
        children [
          Shape {
            geometry Cylinder {
              height 0.24
              radius 0.044
            }
          }
        ]
      }
    ]
  }
  %< if (fields.mass.value > 0) { >%
    physics Physics {
      density -1
      mass IS mass
    }
  %< } >%
}
}
